import React from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import LocalGroceryStoreIcon from '@mui/icons-material/LocalGroceryStore';
import LogoutIcon from '@mui/icons-material/Logout';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { Link as RouterLink, useNavigate } from 'react-router-dom';
import { Box, Container } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import './homeStyle.css'
import httpService from '../../services/httpService'

const Home = () => {
    const [openDrawer, setOpenDrawer] = useState(false);

  const handleDrawerOpen = () => {
    setOpenDrawer(true);
  };

  const handleDrawerClose = () => {
    setOpenDrawer(false);
  };

    const handleSignOut = () => {
        localStorage.removeItem("token")
      }
  return (
    <>
        <CssBaseline />
        <AppBar position="relative">
          <Toolbar>
            <MenuIcon onClick={handleDrawerOpen} />

      {/* Drawer lateral */}
      <Drawer anchor="left" open={openDrawer} onClose={handleDrawerClose}>
        <List style={{ width: 250, backgroundColor: 'purple', color: 'white' }}>
          <ListItem button component={RouterLink} to="/account" onClick={handleDrawerClose}>
            <ListItemIcon>
              <AccountCircleIcon />
            </ListItemIcon>
            <ListItemText primary="Conta" />
          </ListItem>
          <ListItem button component={RouterLink} to="/library" onClick={handleDrawerClose}>
            <ListItemIcon>
              <LibraryBooksIcon />
            </ListItemIcon>
            <ListItemText primary="Biblioteca" />
          </ListItem>
          <ListItem button onClick={handleSignOut}>
            <ListItemIcon>
              <LogoutIcon />
            </ListItemIcon>
            <ListItemText primary="Sair" />
          </ListItem>
        </List>
      </Drawer>
            <Box className='moviePlay'>
                <Typography variant="h6" color="inherit" noWrap className='moviePlay_text'>
                    MoviePlay
                </Typography>
            </Box>
  
            <Box style={{ display: 'flex', alignItems: 'center', marginLeft: 'auto' }}>
                <AccountCircleIcon fontSize='large'/>
            </Box>
          </Toolbar>
        </AppBar>
    </> 
  )
}

export default Home
